import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Layout from './components/Layout'; // Import the Layout component
import LoadingPage from './components/LoadingPage';
import LoginPage from './components/LoginPage';
import AdminPage from './components/AdminPage';
import AddFreightAgent from './components/AddFreightAgent';
import AddFreightCoordinator from './components/AddFreightCoordinator';
import AddMainUser from './components/AddMainUser';

const App = () => {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<LoadingPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/admin" element={<AdminPage />} />
          <Route path="/add-freight-agent" element={<AddFreightAgent />} />
          <Route path="/add-freight-coordinator" element={<AddFreightCoordinator />} />
          <Route path="/add-main-user" element={<AddMainUser />} />
        </Routes>
      </Layout>
    </Router>
  );
};

export default App;
